import React from "react";
import Cookies from "universal-cookie";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";

export default function Details() {
  const cookies = new Cookies();
  // Chart options
  const options = {
    chart: {
      type: "column",
      backgroundColor: "#0000"
    },
    title: {
      text: null
    },
    accessibility: {
      announceNewData: {
        enabled: true
      }
    },
    xAxis: {
      type: "category",
      lineColor: "#ccd6eb"
    },
    yAxis: {
      title: {
        text: null
      }
    },
    legend: {
      enabled: false
    },

    series: [
      {
        name: "Watt forbrug",
        borderColor: "#0000",
        color: "#03D9F0",
        data: [
          {
            name: "00",
            y: 62.74
          },
          {
            name: "01",
            y: 10.57
          },
          {
            name: "02",
            y: 7.23
          },
          {
            name: "03",
            y: 5.58
          },
          {
            name: "04",
            y: 4.02
          },
          {
            name: "05",
            y: 1.92
          },
          {
            name: "06",
            y: 7.62
          },
          {
            name: "07",
            y: 7.62
          },
          {
            name: "08",
            y: 7.62
          },
          {
            name: "09",
            y: 7.62
          },
          {
            name: "10",
            y: 7.62
          },
          {
            name: "11",
            y: 7.62
          },
          {
            name: "12",
            y: 7.62
          },
          {
            name: "13",
            y: 7.62
          },
          {
            name: "14",
            y: 7.62
          },
          {
            name: "15",
            y: 7.62
          },
          {
            name: "16",
            y: 7.62
          },
          {
            name: "17",
            y: 7.62
          },
          {
            name: "18",
            y: 7.62
          },
          {
            name: "19",
            y: 7.62
          },
          {
            name: "20",
            y: 7.62
          },
          {
            name: "21",
            y: 7.62
          },
          {
            name: "22",
            y: 7.62
          },
          {
            name: "23",
            y: 7.62
          }
        ]
      }
    ]
  };

  fetch(
    "http://185.50.193.81:5001/api/devices/" +
      cookies.get("currentDeviceID") +
      "/statistics",
    {
      method: "GET",
      headers: {
        Authorization: "Bearer " + cookies.get("sessionKey"),
        "Content-Type": "application/json"
      }
    }
  )
    .then(response => {
      return response.text();
    })
    .then(response => {
      var jsonData = JSON.parse(response);
      console.log(jsonData);
      var i;
      for (i = 0; i < jsonData.items.length; i++) {
        console.log(jsonData.statistics.items[i].value);
      }
      console.log(response);
    });

  return (
    <div className="row">
      <div className="col col-12">
        <h1>Detaljer</h1>
        <div className="card" style={{ overflow: "hidden", width: "50%" }}>
          <div className="card-body">
            <HighchartsReact highcharts={Highcharts} options={options} />
          </div>
        </div>
      </div>
    </div>
  );
}
